class WolfComicSource extends ComicSource {
  // Required metadata
  name = "늑대닷컴";
  key = "wolf_comics";
  version = "1.2.2";
  minAppVersion = "1.0.0";
  url = "https://github.com/Y-Ymeow/venera-configs/raw/main/wolf.js";

  // Class properties
  domainNumber = 0;

  // --- 1. 核心数据常量 (替换为 Node.js 生成的值) ---
  // 示例值，请务必替换
  EUCKR_DATA_BASE64 =
    "";
  // 查找表的分区和大小
  DECODE_OFFSET = 0;
  ENCODE_OFFSET = 131072;
  MAX_BYTE_INDEX = 65536;
  MAX_UNICODE_INDEX = 55296;

  // init() method for asynchronous initialization
  init() {
    this.domainNumber = this.loadData("domainNumber") || "393";
    // --- 2. 内部 TypedArray 实例 ---
    /** @type {Uint16Array} */
    this.DECODE_ARRAY = null;
    /** @type {Uint16Array} */
    this.ENCODE_ARRAY = null;

    // --- 3. 初始化逻辑 ---
    try {
      this._initDecode(
        this.EUCKR_DATA_BASE64,
        this.DECODE_OFFSET,
        this.ENCODE_OFFSET,
        this.MAX_BYTE_INDEX,
        this.MAX_UNICODE_INDEX,
      );
      console.log("EUC-KR 编解码器初始化成功。");
    } catch (e) {
      console.error("EUC-KR 编解码器初始化失败:", e);
    }
  }

  get baseUrl() {
    return `https://wfwf${this.domainNumber}.com`;
  }

  // Helper method to show an input dialog
  async showInputDialog(title, validator) {
    return UI.showInputDialog(title, validator);
  }

  // Helper method to show a toast message
  showToast(message) {
    UI.showMessage(message);
  }

  // Settings
  settings = {
    sourceType: {
      type: "select",
      title: "콘텐츠 유형",
      options: [
        {
          value: "webtoon",
          text: "웹툰 (Webtoon)",
        },
        {
          value: "comic",
          text: "만화책 (Comic)",
        },
        {
          value: "photo",
          text: "포토툰 (Photo)",
        },
      ],
      default: "webtoon",
    },
    domainNumber: {
      type: "callback",
      title: "도메인 번호 설정",
      description: "Wolf Comics 웹사이트의 도메인 번호를 수동으로 입력하세요",
      callback: async () => {
        const newDomainNumber = await this.showInputDialog(
          "새 도메인 번호 입력",
          (value) => {
            if (!value || isNaN(parseInt(value))) {
              return "유효한 숫자를 입력하세요";
            }
            return null;
          },
        );
        if (newDomainNumber) {
          this.saveData("domainNumber", newDomainNumber);
          this.domainNumber = newDomainNumber;
          this.showToast(`도메인이 업데이트됨: ${newDomainNumber}`);
        }
      },
    },
    autoRefresh: {
      type: "callback",
      title: "도메인 자동 갱신",
      description: "웹사이트에서 최신 도메인 번호를 자동으로 가져옵니다",
      callback: async () => {
        try {
          this.showToast("업데이트 확인 중...");
          const html = await this.fetchWithEucKrEncoding(this.baseUrl);

          // This selector is based on the logic from the Wolf.kt file
          const linkElement = html.querySelector("#pop-content a");

          if (!linkElement) {
            this.showToast(
              "새로운 도메인 링크를 찾을 수 없습니다. 현재 도메인이 최신일 수 있습니다.",
            );
            return;
          }

          const newUrl = linkElement.attributes["href"];
          const domainRegex = /wfwf(\d+)\.com/;
          const match = newUrl.match(domainRegex);

          if (match && match[1]) {
            const newDomainNumber = match[1];
            if (newDomainNumber !== this.domainNumber) {
              this.saveData("domainNumber", newDomainNumber);
              this.domainNumber = newDomainNumber;
              this.showToast(
                `도메인이 자동으로 업데이트됨: ${newDomainNumber}`,
              );
            } else {
              this.showToast("도메인이 이미 최신입니다.");
            }
          } else {
            this.showToast("링크에서 도메인 번호를 파싱할 수 없습니다.");
          }
        } catch (e) {
          this.showToast(`업데이트 확인 실패: ${e.message}`);
        }
      },
    },
  };

  // Explore section
  explore = [
    {
      type: "multiPageComicList",
      title: "늑대닷컴", // Same as in Wolf.kt
      load: async (page) => {
        const sourceType = this.loadSetting("sourceType") || "webtoon";
        let browsePath = "ing"; // Default to webtoon (from WolfFactory.kt: Wolf("웹툰", "ing", "list", "view"))
        if (sourceType === "comic") {
          browsePath = "cm"; // Comic (from WolfFactory.kt: Wolf("만화책", "cm", "cl", "cv"))
        } else if (sourceType === "photo") {
          browsePath = "pt"; // Photo (from WolfFactory.kt: Wolf("포토툰", "pt", "list", "view"))
        }

        const url = `${this.baseUrl}/${browsePath}?type1=day&type2=recent&o=n&page=${page}`;
        const html = await this.fetchWithEucKrEncoding(url);
        if (!html) {
          throw new Error(`최신 만화 불러오기 실패`);
        }
        const comics = html
          .querySelectorAll(".webtoon-list > ul > li > a")
          .map((item) => this.parseComic(item));
        return {
          comics: comics,
          hasNextPage: html.querySelector(".next-page") !== null, // Check for next page selector
        };
      },
    },
    // You can add a "Featured" section here if the website has one.
    // For now, mirroring Wolf.kt's primary browse function in categories.
  ];

  // Category System
  category = {
    title: "늑대닷컴",
    parts: [
      {
        name: "카테고리",
        type: "fixed",
        categories: [
          {
            label: "모든",
            target: {
              page: "category",
              attributes: {
                category: "all",
                param: "",
              },
            },
          },
        ],
      },
    ],
  };

  // Category Comics System
  categoryComics = {
    // Define optionList directly here as a property of categoryComics
    optionList: [
      {
        label: "", // Label can be empty as per _template_.js example
        options: ["latest-최근 업데이트", "popular-인기작품"],
      },
    ],

    load: async (categoryKey, optionKey, page) => {
      const sourceType = this.loadSetting("sourceType") || "webtoon";
      let browsePath = "ing"; // Default to webtoon
      if (sourceType === "comic") {
        browsePath = "cm"; // Comic
      } else if (sourceType === "photo") {
        browsePath = "pt"; // Photo
      }

      let url = "";
      if (categoryKey === "all") {
        if (optionKey === "latest") {
          url = `${this.baseUrl}/${browsePath}?type1=day&type2=recent&o=n&page=${page}`;
        } else if (optionKey === "popular") {
          url = `${this.baseUrl}/${browsePath}?type1=day&type2=recent&o=f&page=${page}`;
        } else {
          // Default to latest if no specific option is chosen for 'all'
          url = `${this.baseUrl}/${browsePath}?type1=day&type2=recent&o=n&page=${page}`;
        }
      } else {
        // Handle other categories if added later
        throw new Error(`Unknown category: ${categoryKey}`);
      }

      const html = await this.fetchWithEucKrEncoding(url);
      if (!html) {
        throw new Error(`카테고리 만화 불러오기 실패`);
      }
      const comics = html
        .querySelectorAll(".webtoon-list > ul > li > a")
        .map((item) => this.parseComic(item));

      return {
        comics: comics,
        hasNextPage: html.querySelector(".next-page") !== null, // Check for next page selector
      };
    },
  };

  // Search System
  search = {
    load: async (query, options, page) => {
      // options and page are part of the search signature
      if (query.length < 2) {
        throw new Error("두 글자 이상 입력 해주세요.");
      }
      // In Wolf.kt, they replace special characters and encode with EUC-KR.
      // JavaScript's encodeURIComponent uses UTF-8. If search results are incorrect,
      // you might need a custom EUC-KR encoding function.
      // Regex from Wolf.kt: `[^\\p{InHangul_Syllables}0-9a-z ]`
      const stdQuery = query.replace(/[^가-힣0-9a-zA-Z ]/gu, ""); // Regex for Korean, numbers, alphabet and space
      const encodedQuery = this.encodeURIComponentEUCKR(query); // Using UTF-8, but EUC-KR is used in original
      const sourceType = this.loadSetting("sourceType") || "webtoon";
      let browsePath = "ing"; // Default to webtoon
      if (sourceType === "comic") {
        browsePath = "cm"; // Comic
      } else if (sourceType === "photo") {
        browsePath = "pt"; // Photo
      }

      const searchUrl = `${this.baseUrl}/search.html?q=${encodedQuery}`;
      const html = await this.fetchWithEucKrEncoding(searchUrl);
      if (!html) {
        throw new Error(`검색 실패`);
      }
      const entries = html
        .querySelectorAll("article.searchItem")
        .filter((el) => {
          // In the original Wolf.kt, href contains entryPath which is different based on source type
          // For example, webtoons use "list", comics use "cl", etc.
          const href =
            el.querySelector("a.searchLink")?.attributes["href"] || "";
          if (sourceType === "comic") {
            return href.includes("cl"); // For comics
          } else {
            return href.includes("list"); // For webtoon and phototoon
          }
        })
        .map((el) => this.parseSearchComic(el));

      return {
        comics: entries,
        hasNextPage: false,
      };
    },
  };

  // Comic Details & Reading
  comic = {
    loadInfo: async (comicId) => {
      const sourceType = this.loadSetting("sourceType") || "webtoon";
      let entryPath = "list"; // Default to webtoon entry path
      if (sourceType === "comic") {
        entryPath = "cl"; // Use cl for comics (from 만화책)
      } else if (sourceType === "photo") {
        entryPath = "list"; // Use list for phototoon (from 포토툰)
      }

      const url = `${this.baseUrl}/${entryPath}?toon=${comicId}`;
      const html = await this.fetchWithEucKrEncoding(url);
      if (!html) {
        throw new Error("Failed to load comic details");
      }

      const textBox = html.querySelector(".text-box");
      const title = textBox.querySelector("h1").text.trim();

      const desc = textBox.querySelector(".txt").text.trim();

      const sub = textBox
        .querySelector(".sub")
        .text.replace("장르：", "")
        .trim()
        .split("/");

      const chapters = new Map();

      const chaptersEle = html.querySelectorAll(
        ".webtoon-bbs-list a.view_open",
      );
      chaptersEle.map((el) => {
        const href = el.attributes["href"];
        const title = el.querySelector(".subject").text.trim();
        const id = el.querySelector(".num").text.trim();

        chapters.set(id, title);
      });

      const reversedChapters = new Map([...chapters].reverse());

      return new ComicDetails({
        title: title,
        author: "Unknown Author",
        description: desc,
        cover: html.querySelector(".img-box img").attributes["src"],
        tags: {
          标签: sub,
        },
        chapters: reversedChapters,
      });
    },
    loadEp: async (comicId, chapterId) => {
      const sourceType = this.loadSetting("sourceType") || "webtoon";
      // Use the readerPath pattern from WolfFactory.kt: view for webtoon, cv for comic
      let readerPath = "view"; // Default reader path
      if (sourceType === "comic") {
        readerPath = "cv"; // Comic viewer path
      } else if (sourceType === "photo") {
        readerPath = "view"; // Photo viewer path
      }

      const url = `${this.baseUrl}/${readerPath}?toon=${comicId}&num=${chapterId}`;

      const html = await this.fetchWithEucKrEncoding(url);
      if (!html) {
        throw new Error("Failed to load chapter images");
      }
      return {
        images: html
          .querySelectorAll(".image-view img")
          .map(
            (img) => img.attributes["data-original"] || img.attributes["src"],
          ),
      };
    },
  };

  // Helper function to parse comic items from general lists (e.g., explore, categoryComics)
  parseComic(item) {
    const href = item.attributes["href"];
    // Extract parameters manually using regex instead of URLSearchParams
    const getParam = (url, name) => {
      const regex = new RegExp("[?&]" + name + "=([^&]*)");
      const match = url.match(regex);
      return match ? match[1] : null;
    };

    const title = item.querySelector(".txt > .subject").text.trim();
    const cover = item.querySelector(".img > img").attributes["data-original"];

    return {
      title: title || "Unknown Title",
      id: getParam(href, "toon"),
      cover: cover,
    };
  }

  // Helper function to parse comic items from search results
  parseSearchComic(item) {
    const mangaUrlElement = item.querySelector("a.searchLink");
    const href = mangaUrlElement?.attributes["href"];
    // Extract parameters manually using regex instead of URLSearchParams
    const getParam = (url, name) => {
      const regex = new RegExp("[?&]" + name + "=([^&]*)");
      const match = url.match(regex);
      return match ? match[1] : null;
    };
    const thumbnailUrlStyle =
      item.querySelector(".searchPng")?.attributes["style"];
    const styleImageRegex = /background-image:url\(([^)]+)\)/;
    const match = thumbnailUrlStyle?.match(styleImageRegex);

    return {
      title:
        item.querySelector(".searchDetailTitle")?.text.trim() ||
        "Unknown Title",
      id: getParam(href, "toon") || "",
      cover: match ? match[1] : "",
    };
  }

  // Helper function to perform network request with proper EUC-KR encoding handling
  async fetchWithEucKrEncoding(url, options = {}) {
    // Set default headers for Korean content if not provided
    const headers = {
      "User-Agent":
        "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.124 Safari/537.36",
      "Accept-Language": "ko-KR,ko;q=0.9,en-US;q=0.8,en;q=0.7",
      "Accept-Charset": "utf-8, euc-kr, *;q=0.1",
      Referer: this.baseUrl + "/",
      ...options.headers,
    };

    const res = await fetch(url, { headers });

    if (res.status !== 200) {
      throw new Error(`Request failed with status ${res.status}`);
    }

    // Get raw buffer and convert from EUC-KR to UTF-8

    let content;
    content = await res.arrayBuffer();
    content = this.decodeEucKrBuffer(content);

    return new HtmlDocument(content);
  }

  // 初始化查找表
  _initDecode(
    base64Str,
    DECODE_OFFSET,
    ENCODE_OFFSET,
    MAX_BYTE_INDEX,
    MAX_UNICODE_INDEX,
  ) {
    // 1. Base64 解码为字节数组 (普通 Array)
    const bytes = Convert.decodeBase64(base64Str);

    // 2. 构造 ArrayBuffer 和 DataView
    // **警告:** 这一步依赖 QuickJS 对 TypedArray 和 DataView 的完整支持
    const byteArray = new Uint8Array(bytes);
    const dataView = new DataView(byteArray.buffer);

    // 3. 构造 DECODE_ARRAY (EUCKR -> Unicode)
    const decodeCount = MAX_BYTE_INDEX;
    this.DECODE_ARRAY = new Uint16Array(decodeCount);
    for (let i = 0; i < decodeCount; i++) {
      // getUint16(byteOffset, littleEndian)
      this.DECODE_ARRAY[i] = dataView.getUint16(DECODE_OFFSET + i * 2, true);
    }

    // 4. 构造 ENCODE_ARRAY (Unicode -> EUCKR)
    const encodeCount = MAX_UNICODE_INDEX;
    this.ENCODE_ARRAY = new Uint16Array(encodeCount);
    for (let i = 0; i < encodeCount; i++) {
      this.ENCODE_ARRAY[i] = dataView.getUint16(ENCODE_OFFSET + i * 2, true);
    }
  }

  decodeEucKrBuffer(buffer) {
    // 使用 Uint8Array 视图来高效读取字节
    const bytes = new Uint8Array(buffer);
    const charCodes = [];
    let result = []; // 存储字符，最后 join

    // QuickJS 环境通常没有 TextDecoder("euc-kr")，所以我们手动处理
    let i = 0;
    while (i < bytes.length) {
      const byte = bytes[i];

      // 1. ASCII 字符 (单字节)
      if (byte < 0x80) {
        result.push(String.fromCharCode(byte)); // 推入数组
        i++;
      }

      // 2. EUC-KR 字符 (双字节)
      else {
        // 确保有第二个字节
        if (i + 1 >= bytes.length) {
          // 遇到奇数个字节，通常是错误，用替换字符代替
          result += String.fromCharCode(0xfffd);
          break;
        }

        const b1 = byte;
        const b2 = bytes[i + 1];

        // 使用我们 O(1) 的核心解码函数
        const decodedChar = this.decodeEucKrOptimized(b1, b2);

        if (decodedChar) {
          result.push(decodedChar); // 推入数组
        } else {
          result.push(String.fromCharCode(0xfffd));
        }

        i += 2; // 跳过 B1 和 B2 两个字节
      }
    }

    return result.join("");
  }

  // ====================================================================
  // 解码函数 (EUC-KR 字节 -> Unicode 字符串)
  // ====================================================================

  /**
   * O(1) 查找：将 EUC-KR 字节 B1 和 B2 解码为 Unicode 字符。
   * @param {number} b1
   * @param {number} b2
   * @returns {string | undefined}
   */
  decodeEucKrOptimized(b1, b2) {
    const index = b1 * 256 + b2;
    // 检查范围，防止越界
    if (index >= this.DECODE_ARRAY.length) return undefined;

    const codePoint = this.DECODE_ARRAY[index];

    // 0 表示未映射或无效的 EUC-KR 字节组合 (我们只存储了双字节部分)
    if (codePoint === 0) {
      return undefined;
    }

    return String.fromCharCode(codePoint);
  }

  // ====================================================================
  // 编码辅助函数 (Unicode 码点 -> B1, B2)
  // ====================================================================

  /**
   * O(1) 查找：将 Unicode 码点转换为 [B1, B2] 字节数组。
   * @param {number} codePoint
   * @returns {number[] | undefined}
   */
  _findEUCKRBytes_O1(codePoint) {
    // 检查范围
    if (codePoint >= this.ENCODE_ARRAY.length) return undefined;

    const eucKrValue = this.ENCODE_ARRAY[codePoint];

    if (eucKrValue === 0) {
      return undefined; // 0 表示没有映射
    }

    // 从 B1*256 + B2 还原
    const b1 = Math.floor(eucKrValue / 256);
    const b2 = eucKrValue % 256;

    return [b1, b2];
  }

  // ====================================================================
  // 编码函数 (Unicode 字符串 -> EUC-KR URI)
  // ====================================================================

  /**
   * 将 Unicode 字符串编码为 EUC-KR URI 格式。
   * @param {string} str
   * @returns {string}
   */
  encodeURIComponentEUCKR(str) {
    let result = "";

    for (let i = 0; i < str.length; i++) {
      const codePoint = str.charCodeAt(i);

      // --- A. ASCII 字符 (< 0x80) ---
      if (codePoint < 128) {
        // ... (ASCII 编码逻辑) ...
        const char = str[i];
        const isUnreserved =
          (codePoint >= 0x41 && codePoint <= 0x5a) ||
          (codePoint >= 0x61 && codePoint <= 0x7a) ||
          (codePoint >= 0x30 && codePoint <= 0x39) ||
          codePoint === 0x2d ||
          codePoint === 0x2e ||
          codePoint === 0x5f ||
          codePoint === 0x21 ||
          codePoint === 0x7e ||
          codePoint === 0x2a ||
          codePoint === 0x27 ||
          codePoint === 0x28 ||
          codePoint === 0x29;

        if (isUnreserved) {
          result += char;
        } else {
          const hex = codePoint.toString(16).toUpperCase();
          result += "%" + (hex.length === 1 ? "0" + hex : hex);
        }
      }

      // --- B. 双字节字符 (>= 0x80) ---
      else {
        const eucKrBytes = this._findEUCKRBytes_O1(codePoint);

        if (eucKrBytes && eucKrBytes.length === 2) {
          const b1 = eucKrBytes[0];
          const b2 = eucKrBytes[1];

          const hex1 = b1.toString(16).toUpperCase();
          const hex2 = b2.toString(16).toUpperCase();

          result += "%" + (hex1.length === 1 ? "0" + hex1 : hex1);
          result += "%" + (hex2.length === 1 ? "0" + hex2 : hex2);
        } else {
          result += "%EF%BF%BD"; // 找不到映射
        }
      }
    }

    return result;
  }
}
